const mongoose=require("mongoose");

//schema creation 
const registerSchema=new mongoose.Schema({
    email:{
        type:String,
        required:true,
        unique:true
    },
    name:{
        type:String,
        required:true,
    },
    age:{
        type:Number,
        required:true,
    },
    phone:{
        type:Number,
        required:true,
        unique:true
    },
    
});


//collection creation 
const UserDetail=new mongoose.model('User',registerSchema);

module.exports=UserDetail;    //export used to access this in other file 
